    "2015-08-27T08:50:34.141780",nt"name": "anaho-island-national-wildlife-refuge-notes-on-american-white-pelican-population-calenda-1-e4b19",nt"isopen":
    false,nt"url": null,nt"notes": "This document contains information about
    the American White Pelican population for the Anaho Island National Wildlife Refuge
    in the Stillwater National Wildlife Refuge Complex from calendar years 1971 to 1980.
    Documents within in the collection include handwritten notes, offices memorandums,
    bird counts, typed reports, newspaper clippings and aerial photographs. Species
    covered in the research are American White Pelican, Doublecrested Cormorant, Canada
    Goose, California Gull, Caspian Tern, Great Blue Heron, and miscellaneous other
    birds. Research and survey proposals and post mortem health reports are among the
    documents in this collection.",nt"license_title": "License Not Specified",nt"extras":
